  public void solve(char[][] board) {
    if (board == null)
      return;
    int m = board.length;
    if (m == 0)
      return;
    int n = board[0].length;



    LinkedList<BoardNode> queue = new LinkedList<BoardNode>();
    for (int i = 0; i < m; i++)
      for (int j = 0; j < n; j++) {
        if (i == 0 || j == 0 || i == m - 1 || j == n - 1) {
          if (board[i][j] == 'O') {
            board[i][j] = '+';
            queue.add(new BoardNode(i, j));
            while (!queue.isEmpty()) {
              BoardNode cur = queue.remove(0);
              int x = cur.x, y = cur.y;
              if (x > 0 && board[x - 1][y] == 'O') {
                board[x - 1][y] = '+';
                queue.add(new BoardNode(x - 1, y));
              }
              if (y > 0 && board[x][y - 1] == 'O') {
                board[x][y - 1] = '+';
                queue.add(new BoardNode(x, y - 1));
              }
              if (x < m - 1 && board[x + 1][y] == 'O') {
                board[x + 1][y] = '+';
                queue.add(new BoardNode(x + 1, y));
              }
              if (y < n - 1 && board[x][y + 1] == 'O') {
                board[x][y + 1] = '+';
                queue.add(new BoardNode(x, y + 1));
              }
            }
          }
        }
      }


    for (int i = 0; i < m; i++)
      for (int j = 0; j < n; j++)
        if (board[i][j] != '+')
          board[i][j] = 'X';
        else
          board[i][j] = 'O';
  }

  void DFS(char[][] board, int i, int j) {
    board[i][j] = '+';
    if (i - 1 >= 0 && board[i - 1][j] == 'O')
      DFS(board, i - 1, j);
    if (j + 1 < board[0].length && board[i][j + 1] == 'O')
      DFS(board, i, j + 1);
    if (i + 1 < board.length && board[i + 1][j] == 'O')
      DFS(board, i + 1, j);
    if (j - 1 >= 0 && board[i][j - 1] == 'O')
      DFS(board, i, j - 1);
  }
